package com.bridgelabz;

/**
 * @author Dell
 *
 */
public class StringEqual {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		String s1="Welcome";
		String s2="Hello";
		
		if(s1.equals(s2))
			System.out.println("Both Strings are equal");
		else
			System.out.println("Both Strings are not equal");

	}

}
